const { WebMidi } = require('webmidi');

export const WebMidiComponent = () => {
  WebMidi.enable()
    .then(() => console.log('WebMidi enabled!'))
    .catch((err) => alert(err));
  return <h1>WebMidi</h1>;
};

WebMidi.enable((err) => {
  console.log(WebMidi.inputs);
  console.log(WebMidi.outputs);
});
